require 'net/http'
require 'mail'
require 'json'

class ApplicationController < ActionController::Base
	layout false
	Mail.defaults do
		delivery_method :smtp, {
			:port	  => 587,
			:address   => '',
			:user_name => '',
			:password  => ''
		}
	end

  	VERSION = 'v20161130_dx1.0'
	DEFAULT_USER_BANNER = 'data:image/png;base64,'
	DEFAULT_USER_PHOTO = 'data:image/png;base64,'
	DEFAULT_LOGO = 'data:image/png;base64,'
	# APP_CONFIG = YAML::load_file("#{::Rails.root}/config/1know.yml")

	#get config from db
	APP_CONFIG = {
		'version' => VERSION,
		'upload_path' => [{}],
		'konzesys' => {},
		'qiniu' => {}
	}
	content = Sysconfig.where( :target => ["system", "subsystem", "frontpage"] ).select("name, content").to_a
	if !content.nil?
		content.each do |item|
			# logger.debug "#{item.name} is #{item.content}"
			case item.name
			when 'upload_doc_url'
				APP_CONFIG['upload_path'][0]['doc'] = item.content
			when 'upload_image_url'
				APP_CONFIG['upload_path'][0]['image'] = item.content
			when 'upload_video_url'
				APP_CONFIG['upload_path'][0]['video'] = item.content
			
			when 'konzesys_activate'
				APP_CONFIG['konzesys']['activate'] = (item.content == 'true')
			when 'konzesys_url'
				APP_CONFIG['konzesys']['url'] = item.content
			
			when 'oauth_client_id'
				APP_CONFIG['client_id'] = item.content
			when 'oauth_client_secret'
				APP_CONFIG['client_secret'] = item.content
			when 'oauth_redirect_uri'
				APP_CONFIG['redirect_uri'] = item.content
			
			when 'qiniu_activate'
				APP_CONFIG['qiniu']['activate'] = (item.content == 'true')
			when 'qiniu_access_key'
				APP_CONFIG['qiniu']['access_key'] = item.content
			when 'qiniu_secret_key'
				APP_CONFIG['qiniu']['secret_key'] = item.content
			when 'qiniu_domain'
				APP_CONFIG['qiniu']['domain'] = item.content
			when 'qiniu_bucket_access_key'
				APP_CONFIG['qiniu']['bucket_access_key'] = item.content
			when 'qiniu_bucket_secret_key'
				APP_CONFIG['qiniu']['bucket_secret_key'] = item.content

			when 'logo'
				APP_CONFIG['logo'] = (item.content != nil and item.content != '') ? "/images/logo.png" : ""
			when 'need_activation'
				APP_CONFIG['need_activation'] = (item.content == 'true')
			when 'hide_account_type'
				APP_CONFIG['hide_account_type'] = (item.content == 'true')
			when 'hide_sys_introduce'
				APP_CONFIG['hide_sys_introduce'] = (item.content == 'true')
			when 'disable_trial_account'
				APP_CONFIG['disable_trial_account'] = (item.content == 'true')
			when 'disable_tempuse_code'
				APP_CONFIG['disable_tempuse_code'] = (item.content == 'true')

			when 'front_hide_default_discovery'
				APP_CONFIG['front_hide_default_discovery'] = (item.content == 'true')
			when 'front_hide_search_banner'
				APP_CONFIG['front_hide_search_banner'] = (item.content == 'true')
			when 'front_slider_activate'
				APP_CONFIG['front_slider_activate'] = (item.content == 'true')
			when 'front_twobanner_activate'
				APP_CONFIG['front_twobanner_activate'] = (item.content == 'true')
			when 'front_tagfunction_activate'
				APP_CONFIG['front_tagfunction_activate'] = (item.content == 'true')
			else
				APP_CONFIG[item.name] = item.content
			end
		end
	end

	def version
		render :text => VERSION
	end
	#delete unit file
	def chooser_delete_file(item)
		puts "delete #{item.uqid} uqid file"
		realdirectory = APP_CONFIG['upload_path'].first
		realdirectory.each {|key, value|
			%w{ .doc .docx .xls .xlsx .ppt .pptx .pdf .mp4 .jpg .png }.each{|ext|
				if File.exist? File.join(value,"#{item.uqid}#{ext}")
					FileUtils.rm(File.join(value,"#{item.uqid}#{ext}"))
				end
			}
		}
	end
	#copy unit file
	#before use this , source and target unit should alearady exist
	def chooser_copy_file(source, target)
		puts "copy #{source.uqid} uqid to #{target.uqid} file"
		realdirectory = APP_CONFIG['upload_path'].first
		realdirectory.each {|key, value|
			%w{ .doc .docx .xls .xlsx .ppt .pptx .pdf .mp4 .jpg .png }.each{|ext|
				if File.exist? File.join(value,"#{source.uqid}#{ext}")
					FileUtils.cp(File.join(value,"#{source.uqid}#{ext}"),File.join(value,"#{target.uqid}#{ext}"))
				end
			}
		}
		target.content_url = source.content_url.gsub(source.uqid,target.uqid) if not source.content_url.nil?
		target.content = source.content.gsub(source.uqid,target.uqid) if not source.content.nil?
		target.save()
	end
	def get_image(type, target)
		if (['channel', 'channel_category', 'group', 'knowledge'].include?(type))
			#object = "#{request.protocol}#{request.host_with_port}/images/#{type}/#{target[:uqid]}.png"
			object = "/images/#{type}/#{target[:uqid]}.png"
		elsif type == 'user'
			#object = "#{request.protocol}#{request.host_with_port}/images/user/#{target[:uqid]}_banner.png" if target[:type] == 'banner'
			#object = "#{request.protocol}#{request.host_with_port}/images/user/#{target[:uqid]}_photo.png" if target[:type] == 'photo'
			object = "/images/user/#{target[:uqid]}_banner.png" if target[:type] == 'banner'
			object = "/images/user/#{target[:uqid]}_photo.png" if target[:type] == 'photo'
		end

		return object
	end

	def set_image(type, target)
		upload_url = APP_CONFIG['upload_icons_url']

		if (['channel', 'channel_category', 'group', 'knowledge'].include?(type))
			Thread.new do
				if target[:logo] != nil and target[:logo] != '' and target[:logo].split('base64,').size == 2
					logo = Base64.decode64(target[:logo].split('base64,')[1])
				else
					logo = Base64.decode64(DEFAULT_LOGO.split('base64,')[1])
				end

				# File.open("public/images/#{type}/#{target[:uqid]}.png", 'wb') {|file| file.write(logo)}
				realpath = File.join(upload_url,"#{type}/#{target[:uqid]}.png")
				dirname = File.dirname(realpath)
				unless File.directory?(dirname)
					FileUtils.mkdir_p(dirname)
				end
				File.open(realpath, 'wb') {|file| file.write(logo)}
			end
		elsif type == 'user'
			Thread.new do
				if target[:banner] != nil and target[:banner] != '' and target[:banner].split('base64,').size == 2
					banner = Base64.decode64(target[:banner].split('base64,')[1])
				else
					banner = Base64.decode64(DEFAULT_USER_BANNER.split('base64,')[1])
				end

				# File.open("public/images/#{type}/#{target[:uqid]}_banner.png", 'wb') {|file| file.write(banner)}
				realpath = File.join(upload_url,"#{type}/#{target[:uqid]}_banner.png")
				dirname = File.dirname(realpath)
				unless File.directory?(dirname)
					FileUtils.mkdir_p(dirname)
				end
				File.open(realpath, 'wb') {|file| file.write(banner)}

				if target[:photo] != nil and target[:photo] != '' and target[:photo].split('base64,').size == 2
					photo = Base64.decode64(target[:photo].split('base64,')[1])
				else
					photo = Base64.decode64(DEFAULT_USER_PHOTO.split('base64,')[1])
				end

				# File.open("public/images/#{type}/#{target[:uqid]}_photo.png", 'wb') {|file| file.write(photo)}
				realpath = File.join(upload_url,"#{type}/#{target[:uqid]}_photo.png")
				dirname = File.dirname(realpath)
				unless File.directory?(dirname)
					FileUtils.mkdir_p(dirname)
				end
				File.open(realpath, 'wb') {|file| file.write(photo)}
			end
		elsif type == 'config'
			Thread.new do
				if target[:logo] != nil and target[:logo] != '' and target[:logo].split('base64,').size == 2
					logo = Base64.decode64(target[:logo].split('base64,')[1])
					# File.open("public/images/logo.png", 'wb') {|file| file.write(logo)}

					realpath = File.join(upload_url,"logo.png")
					dirname = File.dirname(realpath)
					unless File.directory?(dirname)
						FileUtils.mkdir_p(dirname)
					end
					File.open(realpath, 'wb') {|file| file.write(logo)}
				end
			end
		end
	end

	def check_session
		if session[:userinfo] == nil
			render :json => { error: "We're sorry, but something went wrong." }
			return
		end
	end

	def parse_full_name(first_name, last_name, email, nouser)
		if session[:userinfo] != nil
			if [first_name, last_name].join('') == ''
				full_name = email.split('@')[0]
				if nouser
					full_name = ['zh-tw', 'zh-cn'].include?(session[:userinfo][:language][:type]) ? "_#{full_name}" : "Guest_#{full_name}"
				end
			else
				full_name = ['zh-tw', 'zh-cn'].include?(session[:userinfo][:language][:type]) ? "#{last_name}#{first_name}" : "#{first_name} #{last_name}"
			end
		else
			if [first_name, last_name].join('') == ''
				full_name = email.split('@')[0]
				if nouser
					full_name = "Guest_#{full_name}"
				end
			else
				full_name = "#{first_name} #{last_name}"
			end
		end

		return full_name
	end

	def detectmobile()
		return (request.env['HTTP_USER_AGENT'].match(/Android/i) or request.env['HTTP_USER_AGENT'].match(/webOS/i) or request.env['HTTP_USER_AGENT'].match(/iPhone/i) or request.env['HTTP_USER_AGENT'].match(/iPad/i) or request.env['HTTP_USER_AGENT'].match(/iPod/i) or request.env['HTTP_USER_AGENT'].match(/BlackBerry/i) or request.env['HTTP_USER_AGENT'].match(/Windows Phone/i))
	end
end
